import styled from 'styled-components';

const HeaderContainer = styled.header`
    display: flex;
    justify-content: space-between;
    border-bottom: 1px solid black;
    height: 100%;
    padding: 0 30px 0 30px;

    .header div {
    display: flex;
    justify-content: space-between;
    width: 120px;
}

.header div img {
    margin-bottom: 20px;
}

.header div i {
    padding-top: 7px;
}

.foto {
    height: 30px;
    width: 30px;
    border-radius: 1000px;
    cursor: pointer;
}


.icon-tema {
    width: 30px;
    height: 30px;
    cursor: pointer;
}
`;

function Header({ titulo }) {
  return (
    <HeaderContainer>
      TESTE
    </HeaderContainer>
  );
}

export default Header;
